import React from "react";
import { css } from "@emotion/core";
import { COLORS } from "../../constants";
const SideNavLinks = () => {
  return (
    <React.Fragment>
      <ul
        css={css`
          height: calc(100% - 190px);
          overflow-y: auto;
          overflow-x: hidden;
          padding: 10px 40px 10px 40px;
          & > li {
            padding: 8px 0px;
            color: ${COLORS.TEXTGRAY};
            border-bottom: 1px solid ${COLORS.DARKBORDER};
            font-size: 13px;
          }
          & > li:nth-last-child() {
            border: none;
          }
        `}
      >
        <li>Dashboard</li>
        <li>Imports</li>
        <li>Notifications</li>
        <li>Profile</li>
        <li>Allocated Courses</li>
        <li>Cource Coordinator Allocation</li>
        <li>Class Schedule</li>
        <li>Mentoring</li>
        <li>Exam Schedule</li>
        <li>Reports</li>
        <li>Query Form</li>
        <li>Skins</li>
      </ul>
    </React.Fragment>
  );
};

export default SideNavLinks;
